    'views.site.index.link.signup-game' => 'register in the game',
    'views.site.index.link.support' => 'site support',
    'views.site.index.p.1' => 'Surely each of us dreamed of feeling like a coach or manager of a real rugby club. An exciting search for talented players, the gradual development of infrastructure, the choice of suitable tactics for the game, regular matches and, of course, victories, titles and new achievements! This is exactly what awaits you in our world of virtual rugby. Dive into it and create your dream club! ',
    'views.site.index.p.2' => 'Our project is open to everyone! To start playing, you just need to go through the elementary registration procedure. <strong> Virtual Rugby League </strong> is a powerful online rugby manager that gives you the opportunity to go through the exciting journey of developing your team from lower divisions to victories in national championships and world cups! ',
    'views.site.index.p.3' => 'Please note that our online rugby manager is a browser game. Therefore, you will not need to download any client programs, waste time on their tedious installation and subsequent configuration. To play, you only need access to the Internet and a few minutes of free time. However, participation in tournaments is <strong> absolutely free </strong>. ',
    'views.site.index.p.4' => 'We would like to emphasize that in order to achieve success, you do not need to sit at the computer all day. To gradually develop your club, participate in transfers and play calendar matches, you just need to be able to visit our website at least several times a week. ',
    'views.site.index.p.5' => 'Online Rugby Manager <strong> Virtual Rugby League </strong> is more than a regular game. It is a community of people who are united by a passion and love for rugby. Here you can definitely find interesting people, make new acquaintances and just have a great time in a relaxed and maximally comfortable atmosphere. Go ahead, it\'s time to take the coaching chair and manager\'s office! ',
    'views.site.index.p.6' => 'In order to become a member of the game, you need:',
    'views.site.index.p.7' => 'You can ask experienced players on {forum} if you have any questions. You can write about all problems and questions to {support}. ',
    'views.site.index.p.8' => '<span class = "strong"> Today\'s birthday </span> is celebrated by managers:',
