    'views.store.p.2' => 'If you like this game, if you want to use a more comfortable interface without ads and with additional pages, stand out as a VIP badge, manage a large number of teams, or maybe you just have a desire and the opportunity to support our future work - we recommend that you pay a small fee and become a VIP manager. Thank you!',
    'views.store.p.3' => 'Team development does not require making purchases in the store, but if you are not used to waiting, you want "everything at once" and have the opportunity to "speed up the process", then welcome to the game store ! Prices for different teams are different - the stronger the team, the more difficult it is to strengthen it with the help of the store: ',
    'views.store.payment.big' => '<span class = "strong"> Attention! </span> When replenishing a cash account with one payment for a large amount, bonuses are entitled: <br/> if the amount of replenishment is <span class = "strong"> from 100 </span> cash account units, then you will receive <span class = "strong"> + 10% of the amount </span> as a gift. ',
