    'views.store.payment.p.2' => 'We provide you with <span class = "strong"> as many ways as possible to fund your account </span>, no matter where you are in the world. You can exercise the right to credit <span class = "strong"> 1 unit </span> to your cash account for about <span class = "strong"> {amount} </span>, but the exact cost depends on the payment method. Choose the method that works best for you. ',
